import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import styles from './Navbar.module.css';

class Navbar extends Component {
    constructor(props) {
        super(props);
        this.name = props.userName;
    }
    saveCat = (name, image) => {
        fetch('/create', {
            method: 'POST',
            body: JSON.stringify({
                name: name,
                image: image
            }),
            headers: {"Content-Type": "application/json"}
        });
    }

    create = () => {
        fetch('/create-user', {
            method: 'POST'
        })
        .then(res => console.log(res));
    }

    nameHandler = () => {
        console.log(this.name);

        if (this.name == null) {
            return;
        }
        return <button className={styles.NavbarBtnName}>Hello, {this.name}</button>;
    }
    render() {
        return (
            <nav className={styles.Navbar}>
                <div className={styles.homeBtn}>
                    <Link to={'./'}>
                        <button className={styles.NavbarBtn}>
                            home
                        </button>
                    </Link>
                </div>
                <div className={styles.OptionBtns}>
                {this.nameHandler()}
                    <Link to={'./list'}>
                        <button className={styles.NavbarBtn}>
                            My List
                        </button>
                    </Link>
                    <Link to={'./latestBlog'}>
                        <button className={styles.NavbarBtn}>
                            saveCat
                        </button>
                    </Link>
                    <Link to={'./users'}>
                        <button className={styles.NavbarBtn}>
                            My User
                        </button>
                    </Link>
                    <Link to={'./Contact'}>
                        <button className={styles.NavbarBtn}>
                            Contact Me
                        </button>
                    </Link>
                    <button onClick={() => this.saveCat("Bass Creek", "https://placeimg.com/640/480/nature")} className={styles.NavbarBtn}>
                        Create
                    </button>
                </div>
            </nav>
        )
    }
}

export default Navbar
